    //   <tbody>
    //     {products.map((product) => (
    //       <tr key={product.id}>
    //         <td className="py-2 px-4 border-b">
    //           <img
    //             src={product.image}
    //             alt={product.name}
    //             className="w-16 h-16 object-contain"
    //           />
    //         </td>
    //         <td className="py-2 px-4 border-b">
    //           {product.price}
    //         </td>
    //         <td className="py-2 px-4 border-b">
